INSERT INTO program_educations (id, name, code, language, durationYear, levelOfEducation, numCredits, startYear, endYear, universityId, majorId, introduction, sourceLinks, outline, vectorOutline) VALUES
(1, 'Công nghệ thông tin','CN1', 'VI', 4, 'BACHELOR', 120, 2020, 2025, 1, 1, 'Ngành Công nghệ Thông tin đào tạo kiến thức cũng như các kỹ năng quan trọng và hiện đại về Công nghệ thông tin với mục tiêu đạt trình độ chung của khu vực và quốc tế, cho phép sinh viên sau khi tốt nghiệp có thể nhanh chóng đáp ứng các nhu cầu về hoạt động công nghệ thông tin của xã hội cũng như tiếp tục học tập, nghiên cứu và phát triển ngành Công nghệ Thông tin. Sinh viên tốt nghiệp ngành CNTT có thể làm việc tại các công ty công nghệ với nhiều vị trí khác nhau từ lập trình viên, lập trình các hệ thống thông minh, phân tích thiết kế hệ thống, kiểm thử phần mềm, quản trị mạng…','[{"name":"Chương trình đào tạo ngành công nghệ thông tin chuẩn - UET","link":"https://uet.vnu.edu.vn/chuong-trinh-dao-tao-nganh-cong-nghe-thong-tin-4/"},{"name":"Nội dung chương trình đào tạo ngành công nghệ thông tin chuẩn - UET","link":"https://uet.vnu.edu.vn/chuong-trinh-dao-tao-nganh-cong-nghe-thong-tin-10/"}]', 'https://firebasestorage.googleapis.com/v0/b/course-mapping-489fd.appspot.com/o/program_educations%2FVN_QHI_CN1_2022.txt?alt=media&token=7eb720dc-1e77-4feb-b729-0f7ec04d9aa0', '{\"vector\":[0.5712198615074158,0.16519445180892944,0.11144405603408813,-1.1937403678894043,-0.3460646867752075,0.33023637533187866,-0.6960755586624146,0.40053126215934753,-0.9328237771987915,-0.1047358512878418,1.0872950553894043,0.23355211317539215,0.325145423412323,-0.7987232804298401,-0.08368013054132462,-0.18939317762851715,0.08961445838212967,0.2822180390357971,0.2610986530780792,-0.5707789659500122,0.694006085395813,0.5549041628837585,-0.06671780347824097,0.11291627585887909,-0.3042115867137909,-0.16326874494552612,-0.2772977650165558,0.23344622552394867,-0.42865484952926636,0.297036737203598,0.3753095269203186,0.1470634788274765,-0.31645894050598145,-0.098007433116436,0.2306099683046341,-0.058868132531642914,-0.09284962713718414,-0.13869208097457886,0.38925328850746155,-0.681115984916687,-0.04836956039071083,-0.744118511