(2, 'Khoa học máy tính', 'CN8', 'VI', 4.5, 'BACHELOR', 130, 2020, 2025, 1, 1, 'Ngành Khoa học máy tính cung cấp cho sinh viên các kiến thức, kỹ năng cơ bản và hiện đại trong các lĩnh vực truyền thống của CNTT như công nghệ phần mềm, cơ sở dữ liệu, mạng máy tính, kiến trúc máy tính; song các lĩnh vực mới và không kém phần thú vị như xử lý ngôn ngữ tự nhiên, học máy – trí tuệ nhân tạo, tin sinh học, xử lý tiếng nói, xử lý ảnh, tương tác người – máy,… cũng được chú trọng phát triển và đào tạo.','[{"name":"Chương trình đào tạo ngành Khoa học máy tính - UET","link":"https://uet.vnu.edu.vn/chuong-trinh-dao-tao-nganh-cong-nghe-thong-tin-chat-luong-cao-8/"}]', 'https://firebasestorage.googleapis.com/v0/b/course-mapping-489fd.appspot.com/o/program_educations%2FVN_QHI_CN8.txt?alt=media&token=0a2f56e9-fbc7-4f60-9865-1186f9032d43', '{\"vector\":[0.41535085439682007,0.12877562642097473,-0.08662525564432144,-0.7382251620292664,-0.4026714265346527,-0.1397124081850052,-0.5906073451042175,0.849467396736145,-1.2785135507583618,-0.22259370982646942,1.1590979099273682,0.08858362585306168,0.16639070212841034,-0.7835993766784668,0.12699244916439056,-0.6353942155838013,-0.12488839775323868,0.6006024479866028,0.656394898891449,-0.38811594247817993,0.6029420495033264,0.6985954642295837,0.10557518899440765,0.17091773450374603,-0.0731005072593689,-0.10091152042150497,0.3216926157474518,0.3704583942890167,-0.5601238012313843,0.035955559462308884,0.4750405251979828,0.03514714911580086,-0.1311735361814499,0.20768027007579803,-0.12427809834480286,0.015441703610122204,0.10268104076385498,-0.6070134043693542,0.512146532535553,-0.8512764573097229,-0.6401887536048889,-1.0104109048843384,-0.10894505679607391,0.12076914310455322,-0.10830171406269073,-0.13603700697422028,0.35152581334114075,-0.24997904896736145,0.2046831101179123,-0.20029021799564362,0.09800248593091965,-0.16917872428894043,-0.27059653401374817,-0.08715615421533585,0.08959191292524338,0.2249617725610733,0.16084012389183044,1.29928815364