(4, 'Trí tuệ nhân tạo','CN12', 'VI', 4, 'BACHELOR', 120, 2019, 2025, 1, 9, 'Ngành Trí tuệ nhân tạo là một đổi mới trong thông tin tuyển sinh năm 2022 của trường Đại học Công nghệ – Đại học Quốc gia Hà Nội, một hướng phát triển mới dành cho sinh viên nhóm ngành Công nghệ thông tin. Sinh viên ngành Trí tuệ nhân tạo sẽ được giới thiệu và đi sâu nghiên cứu các hệ chuyên gia, tương tác người – máy và ứng dụng trong các môi trường như hệ đa phương tiện; xử lý hình ảnh, âm thanh; phân tích dữ liệu lớn.','[{"name":"Chương trình đào tạo ngành Trí tuệ nhân tạo - UET","link":"https://uet.vnu.edu.vn/chuong-trinh-dao-tao-nganh-tri-tue-nhan-tao-4/"}]','https://firebasestorage.googleapis.com/v0/b/course-mapping-489fd.appspot.com/o/program_educations%2FVN_QHI_CN12.txt?alt=media&token=a3fe6742-3dac-46a7-8785-256c97957145', '{\"vector\":[0.752278208732605,-0.13711747527122498,-0.3530697226524353,-1.286755919456482,0.02079685777425766,0.2748675048351288,-0.6510804295539856,0.5596466064453125,-1.0925524234771729,-0.004734833724796772,1.3088029623031616,0.3797944486141205,0.10541349649429321,-0.636379599571228,-0.22420313954353333,0.146367609500885,0.19390052556991577,0.6051872372627258,0.8661108613014221,-0.567524254322052,0.3978632688522339,0.48783183097839355,0.01508423313498497,-0.01892707869410515,-0.22164002060890198,0.30736416578292847,0.21150851249694824,0.5096516609191895,-0.2509172558784485,-0.06859555095434189,0.7682856321334839,-0.04885893687605858,-0.37014687061309814,-0.12394636869430542,0.11548363417387009,-0.07531008124351501,-0.38890543580055237,-0.3132553696632385,0.24557632207870483,-0.31661996245384216,-0.3568190634250641,-1.1309375762939453,-0.02261556312441826,0.08791007846593857,-0.24497710168361664,0.3071988523006439,0.5194066166877747,-0.38487541675567627,0.04064515605568886,0.03823867067694664,0.4104502201080322,0.2871069014072418,-0.19259992241859436,-0.5290969014167786,0.05877886712551117,0.3684234023094177,0.14353282749652863,0.9273143410682678,-0.5319165587