(7, 'Hệ thống thông tin', 'CN14', 'VI', 4.5, 'BACHELOR', 130, 2020, 2023, 1, 1, 'Chương trình đào tạo cử nhân Hệ thống thông tin (HTTT)  tại Trường Đại học Công nghệ (ĐHCN) thuộc Đại học Quốc gia Hà Nội (ĐHQGHN) nhằm mục tiêu đào tạo các sinh viên trở thành các chuyên gia HTTT chất lượng cao có phẩm chất tốt, có trình độ chuyên môn giỏi, có năng lực tự học suốt đời về HTTT, định hướng vào bốn chủ đề hiện đại của Công nghệ Thông tin (CNTT) trong thời đại số hóa (còn được gọi là Công nghiệp 4.0) là tích hợp dịch vụ, quản lý dữ liệu lớn, khoa học dữ liệu và phân tích kinh doanh.','[{"name":"Chương trình đào tạo ngành Hệ thống thông tin - UET","link":"https://uet.vnu.edu.vn/chuong-trinh-dao-tao-nganh-thong-thong-tin-12/"}]','https://firebasestorage.googleapis.com/v0/b/course-mapping-489fd.appspot.com/o/program_educations%2FVN_QHI_CN14.txt?alt=media&token=add76e16-93cc-4ec3-9535-a1ac6b56c565', '{\"vector\":[0.6394299268722534,-0.2674524784088135,0.18543395400047302,-0.688855767250061,-0.23938173055648804,0.08251921832561493,-0.39690086245536804,0.31803908944129944,-0.7853122353553772,0.09024925529956818,1.1840589046478271,0.2524242699146271,0.2353253960609436,-0.9148374795913696,-0.1763857901096344,-0.3980683982372284,-0.2054932713508606,0.35339948534965515,0.504048228263855,-0.6845847964286804,0.46297988295555115,0.6384135484695435,-0.14590813219547272,-0.3955279588699341,-0.08722271770238876,-0.30692899227142334,0.09097831696271896,0.4390713572502136,-0.3882869482040405,-0.03738119825720787,0.7640430927276611,0.11960624158382416,-0.42247989773750305,-0.14881668984889984,0.02689661830663681,-0.1245131567120552,-0.16784337162971497,-0.12306998670101166,0.5334195494651794,-0.027094092220067978,-0.049101002514362335,-0.8291552066802979,-0.03921150416135788,-0.0699077621102333,-0.0395762175321579,0.003977461252361536,0.1878812313079834,-0.10312671959400177,-0.11068269610404968,0.20071382820606232,0.30257222056388855,0.2943004369735718,-0.04970497265458107,-0.548676848411560