(8, 'Khoa học máy tính', 'IT1', 'VI', 4, 'BACHELOR', 130, 2020, 2025, 3, 1, 'Ngành Khoa học máy tính cung cấp cho sinh viên các kiến thức, kỹ năng cơ bản và hiện đại trong các lĩnh vực truyền thống của CNTT như công nghệ phần mềm, cơ sở dữ liệu, mạng máy tính, kiến trúc máy tính; song các lĩnh vực mới và không kém phần thú vị như xử lý ngôn ngữ tự nhiên, học máy – trí tuệ nhân tạo, tin sinh học, xử lý tiếng nói, xử lý ảnh, tương tác người – máy,… cũng được chú trọng phát triển và đào tạo.', '[{"name":"Tổng hợp các chương trình đào tạo Đại học Bách Khoa Hà Nội","link":"https://ts.hust.edu.vn/tin-tuc/chuong-trinh-dao-tao-chuan-truong-dai-hoc-bach-khoa-ha-noi"}]','https://firebasestorage.googleapis.com/v0/b/course-mapping-489fd.appspot.com/o/program_educations%2FVN_BKA_IT1.pdf?alt=media&token=01551740-3bf6-49f6-9569-4078c9fbbfc9', '{\"vector\":[0.11853743344545364,1.575700044631958,-0.5740593671798706,-1.7730910778045654,0.1233367919921875,1.684231162071228,-0.22368963062763214,0.7917255759239197,-0.5200960636138916,0.32675912976264954,0.07840311527252197,0.4106660783290863,-0.8077120780944824,-0.6474964618682861,-0.47779715061187744,-0.8079031109809875,-0.1835792511701584,0.8871996402740479,1.142376184463501,-0.7857812643051147,1.2032488584518433,0.48019978404045105,-0.6130954027175903,0.5661678314208984,-1.0784978866577148,-0.2079838365316391,-0.23130688071250916,0.8629599213600159,-0.738981306552887,0.35585975646972656,0.13808803260326385,0.32084348797798157,-0.13800013065338135,-0.10894365608692169,-0.4949968457221985,-0.5437782406806946,-0.47462695837020874,-1.122996211051941,0.5638540983200073,-0.3616117537021637,-0.4231780767440796,0.22015023231506348,0.02194967120885849,-0.6899192929267883,-0.2857913374900818,-0.4710833430290222,0.8946311473846436,-0.6891126036643982,0.6519050002098083,0.47505155205726624,0.0055204774253070354,0.6165244579315186,-0.40716493129730225,0.467800110578537,-0.23822060227394104,-0.5231698155403137,0.5890608429908752,1.060649037361145,